/* From Uiverse.io by Praashoo7 - Tags: gradient, loader, circular, Infinite Spin */
/* 

   Design by Adrian Kuleszo
   Number of Keyframes can be increased or decreased based on the smoothness you require.

 */

.loader {
  width: 15em;
  height: 8em;
  border-radius: 15px;
  background: conic-gradient(from 0deg at 50% 50%, #FFFFFF, #1d3a3d);
  animation: 1.5s run infinite linear;
}

